export enum AccountActionType {
    ADD_DATA_LIST = "ADD_DATA_LIST",
    ADD_HISTORY_ORDER = "ADD_HISTORY_ORDER",
    ENTER_LOGIN = "ENTER_LOGIN",
    ADD_DATA_LIST_UKR_POSHTA = "ADD_DATA_LIST_UKR_POSHTA",
    ADD_DATA_LIST_NOVA_POSHTA = "ADD_DATA_LIST_NOVA_POSHTA",
}

export interface AccountState {
    dataList: {
        phone: string,
        username: string,
        password: string,
        deliveryMethod: string,
        surname: string,
        firstName: string,
        middleName: string,
        address: any,
    },

    addressNovaPoshta:{
        postOffice: string,
        city: string,
        street: string,
        number: string,
    }

    addressUkrPoshta: {
        region: string,
        district: string,
        city: string,
        street: string,
        number: string,
        zipcode: string,
    }

    historyOrder: any[],

    login: {
        phone: string,
        password: string,
        login: boolean,
    }
}

interface AccountAddressNovaPoshta {
    type: AccountActionType.ADD_DATA_LIST_NOVA_POSHTA;
    payload: {postOffice: string, city: string, street: string, number: string}
}

interface AccountAddressUkrPoshta {
    type: AccountActionType.ADD_DATA_LIST_UKR_POSHTA;
    payload: {region: string, district: string, city: string, street: string, number: string, zipcode: string}
}

interface AccountDataListAction {
    type: AccountActionType.ADD_DATA_LIST;
    payload: {  phone: string,
                username: string,
                password: string,
                deliveryMethod: string
                surname: string,
                firstName: string,
                middleName: string,
                address:    [{postOffice: string, city: string, street: string, number: string}]
                            | {region: string, district: string, city: string, street: string, number: string, zipcode: string}
                            | string,
    };
}

interface AccountHistoryOrderAction {
    type: AccountActionType.ADD_HISTORY_ORDER;
    payload: any[];
}

interface AccountLoginAction {
    type: AccountActionType.ENTER_LOGIN;
    payload: {phone: string, password: string, login: boolean};
}


export type AccountAction =       AccountDataListAction
                                | AccountHistoryOrderAction
                                | AccountLoginAction
                                | AccountAddressNovaPoshta
                                | AccountAddressUkrPoshta
